"description":"This is an Apple Books audiobook narrated by a digital voice based on a human narrator.<br /><br />Sometimes the person standing in your way is your only hope...<br /><br />As the director of the Port Provident Animal Shelter, Becca Collins had devoted her life to helping the furriest residents of Port Provident. When a special Labrador retriever, Polly, needs her help on the eve of Hurricane Hope, Becca can't say no—even if it means she'll have to ride out the hurricane on Provident Island. When she shows up on the doorstep of local veterinarian and Army veteran Dr. Ross Reeder, Becca throws a wrench into Ross' plans to evacuate himself and his combat-weary former service dog, Cookie.<br /><br />Ross and Becca are used to disagreeing with one another, but they soon realize the only way they're going to survive the wrath of Hurricane Hope is to put their differences aside and work for the good of the animals who depend totally on them. As they discover they have more in common than they thought and work to rebuild the Texas beach town where they've both put down roots, Becca learns secrets about her past that threaten to change the whole direction of her life.<br /><br />As Becca struggles with love, faith, and lies, will she still need the shelter she's found in Ross' arms or will the aftermath of the storm take away everything they've worked to build?<br /><br />Start reading Shelter from the Storm to find hope, heart, and happily-ever-after today!<br /><br />USA Today bestselling&#xa0;author Kristen Ethridge brings readers home to Port Provident, Texas for the Port Provident: Hurricane Hope series—sweet escape romances full of hope, heart and happily-ever-after. These clean romance novels with a light, uplifting thread of faith and love will sweep you up in the story and leave you with a smile.<br /><br />Enjoy the complete Port Provident: Hurricane Hope series!<br />Shelter from the StormThe Doctor's Unexpected FamilyHis Texas PrincessHoliday of H