"description":"This is an Apple Books audiobook narrated by a digital voice based on a human narrator.<br /><br />FIVE STARS FOR THE HIDDEN<br /><br />WHAT READERS ARE SAYING<br /><br />\"Jo Chumas is a brilliant storyteller, her descriptions of Cairo envelope you into their complex stories, you can virtually smell the city and imagine life among the many fascinating characters she has unfolded. A fascinating history into Egypt itself which has made me want to find out more. I was unable to put this book down and now I am at a loss to know what to read next.\"<br /><br />\"A great novel should transport you to a time and place. The Hidden took me straight to the heart of Cairo where the heat and the buzz of the streets, with all their sights, sounds and smells, were tangible. This is an epic tale of loss, love, revenge and revolution, where no-one is quite as they seem. The breadth and scope of the novel, together with tight management of a large cast, are two of Chumas's greatest achievements.\"<br /><br />THE HIDDEN (Book 1, Part 1)<br /><br />Cairo, Egypt, 1919<br /><br />Hezba, the rebellious seventeen-year-old daughter of the Sultan of Egypt, lives a life of luxury in a mansion overlooking the river Nile. Locked away in the harem, she has everything she wants, except the one thing that will keep her from madness; her freedom.<br /><br />The Sultan has ordered Hezba back into the care of her husband, the ageing and abusive Khalil al-Shezira, but Hezba's secret lover has other ideas, so does Hezba. She wants al-Shezira gone from her life and she wants change. She'll stop at nothing to achieve her desires.<br /><br />In 1919, Egypt, and in a world reeling from the devastation of the First World War, Hezba is considered a dangerous female; as the daughter of the Sultan of Egypt, she is expected to do as she is told. But for Hezba, submission is impossible; love, revolution and freedom from repression are worth dying for.<br /><br />Told through her scribblings in her parchment notebook, The Hidden (Book 1, Part 1), was originally published by Thomas &amp; Mercer, USA as The Hidden, a novel that won the Amazon Breakthrough Novel Award (ABNA) in 2013, in the Mystery/Suspense category and became an overnight bestseller.<br /><br />Now published by 8d Press, the original novel The Hidden has become a seven-book series."}, 
