"description":"This professionally narrated audio edition of Napoleon Hill's&#xa0;Classic&#xa0;Think and Grow Rich&#xa0;was recorded using an exact reproduction of Napoleon Hill's personal copy of the first edition, the ONLY original version recommended by The Napoleon Hill Foundation, first printed in March of 1937.<br /><br />As Executive Director of the Napoleon Hill Foundation, I receive many requests from people wanting the original 1937 copy of Think and Grow Rich. To satisfy those of you who desire to have a 1937 unedited copy, we have reproduced Napoleon Hill’s personal copy of the first edition, printed in March of 1937 here. This personal copy of Dr. Hill’s was given to me by Dr. Charles W. Johnson, Chairman of the Napoleon Hill Foundation and a nephew of Napoleon Hill.<br /><br />Hill’s works are highly recognizable and have had long lasting influence worldwide. In fact, Think and Grow Rich sells more copies today than before Dr. Hill died in 1970. Now you can purchase this original Foundation authorized 1937 unedited copy of Think and Grow Rich with confidence you are getting the original message as communicated only by Dr. Hill and you will be supporting the nonprofit Napoleon Hill Foundation.<br /><br />A message from Don Green, Executive Director of the Napoleon Hill Foundation."}, 
