"description":"This is an Apple Books audiobook narrated by a digital voice based on a human narrator.<br /><br />Killing someone isn't meant to be this hard.<br />Neither is loving them.<br /><br />\"Romantic Suspense at its finest\"<br /><br />Imagine a TV drama with sixteen episodes over two seasons, telling a complete story, and bringing you a host of unexpected twists and turns along the way.<br />Pale Moon is that gripping serialised drama, in book form. In sixteen novella-length parts, it will keep you page-turning, and episode-reading!<br />To get the full experience, please do binge the episodes in sequence!<br /><br />This is the opening episode. An MI6 shadow assassin and a beautiful terrorist are thrown together in the midst of a terror threat, the like of which London has never seen before.<br /><br />Their first meeting is engineered by those who never imagined a desperate spark would ignite a deadly inferno. Who did not foresee that an explosive mix of two lost souls would result in an epic journey that was destined to change lives forever.<br /><br />Travel with Gerard and Zana as they follow a life-threatening, perilous road, taking them to a place neither believes can exist...<br /><br />Enjoy!<br /><br />Read about Pale Moon, and everything else we do, on the rtgreen website"}, 
