"description":"From celebrity heartthrob, esteemed host of The Viall Files podcast, and adored member of Bachelor Nation Nick Viall comes Don’t Text Your Ex Happy Birthday—a no-holds-barred dating advice audiobook.<br /><br />With his trademark charm, relationship expertise, and exclusive sex and love Q&amp;A series, Nick guides listeners through topics of love, lust, dating, and heartbreak. Nothing is off limits as he delves into situationships, how to identify a player, and defining healthy love vs. toxic love. Trying to figure out if friends with benefits is worth it? Unsure if they’re really into you? Is the person you’re seeing a walking red flag? Can you come back from being cheated on? Viall is here with all the answers and more.<br /><br />Filled with stories and one-liners you’ll be texting your friends, Don’t Text Your Ex Happy Birthday is an honest, entertaining, and heartfelt relationship handbook that actually answers the question, “What does it mean when they say … ?”"}]
